import React from 'react';
import BasePage from '../BasePage';

const SegmentationUAPage = () => {
    return (
        <BasePage>
            <section className="py-20" style={{
                background: 'linear-gradient(135deg, rgba(254, 200, 162, 0.1) 0%, rgba(254, 215, 170, 0.1) 100%)',
                backgroundImage: 'radial-gradient(rgba(254, 200, 162, 0.08) 1px, transparent 1px)',
                backgroundSize: '22px 22px'
            }}>
                <div className="container mx-auto px-4 sm:px-6 lg:px-8">
                    <div className="text-center max-w-4xl mx-auto">
                        <p className="text-orange-600 text-sm font-medium uppercase tracking-wide mb-4 font-sans">
                            Solutions - By Use Case
                        </p>
                        <h1 className="text-4xl sm:text-5xl md:text-6xl font-display font-semibold text-gray-800 leading-tight mb-6">
                            Segmentation & U&A
                        </h1>
                        <p className="text-xl text-gray-500 max-w-3xl mx-auto leading-relaxed font-sans">
                            Understand hard-to-reach audiences better with advanced segmentation and usage & attitude analysis.
                        </p>
                        <div className="mt-8">
                            <button className="bg-orange-600 hover:bg-orange-700 text-white px-8 py-4 rounded-lg font-display font-medium transition-all duration-200 shadow-sm hover:shadow-md">
                                Learn more about the solution
                            </button>
                        </div>
                    </div>
                </div>
            </section>
        </BasePage>
    );
};

export default SegmentationUAPage;
